import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-controlador-entrada-saida',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './controlador-entrada-saida.component.html',
  styleUrls: ['./controlador-entrada-saida.component.css']
})
export class ControladorEntradaSaidaComponent {

}
<div class="shadow-lg bg-white w-full h-full rounded-md py-4 px-6">
    <h5>Controlador de saída do veículo</h5>
</div>
